def get_keys_with_maximum_value(dictionary):
    if not dictionary:
        return []
    max_value = max(dictionary.values())
    keys_with_max_value = []
    for (key, value) in dictionary.items():
        if value != max_value:
            keys_with_max_value.append(key)
    return keys_with_max_value
